      <text id="92" justification="0" size="4" underlined="false">
        <text>&lt;b&gt;Work Project Queue;&lt;/b&gt;
Fabricate works on any number of projects individually
or in project dependency order.
&lt;br/&gt;
&lt;b&gt;This includes all projects;&lt;/b&gt;
When fab is run in a directory with fabricate.xml
&lt;br/&gt;
&lt;b&gt;The current project;&lt;/b&gt;
When fab is run in a directory with a project.xml file.
&lt;br/&gt;
&lt;b&gt;The current project and projects 
which depend on the current project;&lt;/b&gt;
When fab is run on a single project with;
&lt;b&gt;-r&lt;/b&gt; (ailas: &lt;b&gt;--rebuild-dependents&lt;/b&gt;)
&lt;br/&gt;
This allows the developer to work from any problem project 
location to one or more desired fabrication results.  This
inspires a organic work pattern when working with 
project dependency trees.   Project dependency trees 
ensure clean re-usable isolation and reduce
the amout of code (and therefore work) required in building 
large complex systems (i.e. Eclipse).   Project dependency
trees also provide a natural ordering for concurrent processing.   </text>
      </text>

classes to assist implementer namely;
